      "content": "com.ichi2.anki\n.SharedDecksActivity\nf08e6e48962a98d4f1e710a7c165aec8\ncom.ichi2.anki:id/root_layout,dlarea,com.ichi2.anki:id/shared_decks_fragment_container,navhome,com.ichi2.anki:id/webview_toolbar,navmanual,download,android:id/content,com.ichi2.anki:id/home,linux,com.ichi2.anki:id/search,com.ichi2.anki:id/action_bar_root,android:id/statusBarBackground\nDownload Anki,Linux,Docs,Fully Extensible\nThere are a large number of add-ons available.,AnkiWeb,Powerful, intelligent flash cards.\n,\u4e0b\u8f7d\u724c\u7ec4,Features,Learning a language,Open Source\nBecause the code and storage format is open, your important data is safe.,Michael A. Nielsen, \"Augmenting Long-term Memory\",Mac,About Anki,Installation & troubleshooting guide,Media-Rich,Studying for medical and law exams,Embed audio clips, images, videos and scientific markup on your cards, with precise control over how it's shown.,Home,Download Anki for glibc 2.28+ (24.11),\u2014\u00a0Keldin, via email,Synchronization\nUse the free AnkiWeb synchronization service to keep your cards in sync across multiple devices.,Memorizing people's names and faces,Anki is a program which makes remembering things easy. Because it's a lot more efficient than traditional study methods, you can either greatly decrease your time spent studying, or greatly increase the amount you learn.,Alternate download site,Anki - powerful, intelligent flashcards,\"No other application [...] comes remotely close to Anki in terms of the number and power of features, flexibility in study, or implementation of spaced repetition.\",Optimized\nAnki will handle decks of 100,000+ cards with no problems.,Change notes & older releases,Anki will handle decks of 100,000+ cards with no problems.,Development,K. M. Lawson, \"Anki All the Way\",Downloads,\u2014\u00a0,Anyone who needs to remember things in their daily life can benefit from Anki. Since it is content-agnostic and supports images, audio, videos and scientific markup (via LaTeX), the possibilities are endless.\nFor example:,\u2022 ,Brushing up on geography,Windows,\"I've been using Anki for two years now, and I just wanted to thank you personally for contributing to the single most obvious improvement in my quality of life. I'm not being hyperbolic: consistent use of Anki has opened more doors for me intellectually than I could have imagined two years ago. And being a poor student, I'll be forever grateful that you've provided this software open-source and free of charge.\",Download,Mastering long poems,iPhone/Android,\"The single biggest change that Anki brings about is that it means memory is no longer a haphazard event, to be left to chance. Rather, it guarantees I will remember something, with minimal effort. That is, Anki makes memory a choice.\",Media-Rich\nEmbed audio clips, images, videos and scientific markup on your cards, with precise control over how it's shown.,Optimized,Flexibility\nFrom card layout to review timing, Anki has a wealth of options for you to customize.,Alternate changes site,\n"
